def find_triangle_coordinates(a, b):
    (a, b) = (min(a, b), max(a, b))
    l1 = []
    l2 = []
    for i in range(2, a):
        t = (a * a - i * i) ** 0.5
        if int(t) == t:
            l1.append([int(t), i])
    for i in range(1, b):
        t = (b * b - i * i) ** 0.5
        if int(t) == t:
            l2.append([int(t), -i])
    for i in range(len(l1)):
        for j in range(len(l2)):
            (x1, y1) = l1[i]
            (x2, y2) = l2[j]
            if x1 != x2 and (y2 - y1) ** 2 + (x2 - x1) ** 2 == a ** 2 + b ** 2:
                return ('YES', [(0, 0), (x1, y1), (x2, y2)])
    return ('NO', None)

